import './Home.css';
import { Parallax } from "react-parallax";

const bkg_pic = "https://images.pexels.com/photos/830891/pexels-photo-830891.jpeg";
const insideStyles = {
  background: "white",
  padding: 20,
  position: "absolute",
  top: "50%",
  left: "50%",
  transform: "translate(-50%,-50%)"
};

    // <Parallax
    //     blur={{ min: -15, max: 15 }}
    //     bgImage={require('path/to/another/image.jpg')}
    //     bgImageAlt="the dog"
    //     strength={-200}
    // >
    //     Blur transition from min to max
    //     <div style={{ height: '200px' }} />
    // </Parallax>

function HomePage(props) {
  return (
    <div>
      <div className="Home">
        <div className="HomePage-container">
          <h1>Welcome</h1>
          <div className="HomePage-accent-line"></div>
          <p className="HomePage-bio">
            My name is Ryan Schmid, a computer science Master's student at Lehigh Univeristy. 
            Before my time as a graduate student, I completed two Bachelor's degrees at Lehigh, 
            one in Computer Engineering and the other in Inegrated Business and Engineering (IBE) with a major in Finance 
            as part of the university's IBE Honors Program. This website is a virtual resume that displays many of 
            the experiences I have had at Lehigh as well as some projects and achievements I have done and made along the way.
            </p>
        </div>
      </div> 
      <Parallax
        bgImage={bkg_pic}
        bgImageAlt="Background image"
        strength={200}
      >
        <div style={{ height: 500 }}>
          <div style={insideStyles}>HTML inside the parallax</div>
        </div>
      </Parallax>
    </div>
  );
}

export default HomePage;
